package com.jsp.footmap.model;import java.util.Date;public class ResponseShare {    private int sid;    private String subject;    private Date sendTime;    private String contents;    private String nickname;    private int likeCount;    private int disLikeCount;    private int commentCount;    public int getSid() {        return sid;    }    public void setSid(int sid) {        this.sid = sid;    }    public String getSubject() {        return subject;    }    public void setSubject(String subject) {        this.subject = subject;    }    public Date getSendTime() {        return sendTime;    }    public void setSendTime(Date sendTime) {        this.sendTime = sendTime;    }    public String getContents() {        return contents;    }    public void setContents(String contents) {        this.contents = contents;    }    public String getNickname() {        return nickname;    }    public void setNickname(String nickname) {        this.nickname = nickname;    }    public int getLikeCount() {        return likeCount;    }    public void setLikeCount(int likeCount) {        this.likeCount = likeCount;    }    public int getDisLikeCount() {        return disLikeCount;    }    public void setDisLikeCount(int disLikeCount) {        this.disLikeCount = disLikeCount;    }    public int getCommentCount() {        return commentCount;    }    public void setCommentCount(int commentCount) {        this.commentCount = commentCount;    }}